import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Error from "./pages/Error";
import Signin from "./pages/auth/Signin";
import Logout from "./pages/auth/Logout";
import { PrivateRouteNew } from "./utils/PrivateRouteNew";
import HomeComponent from "./pages/HomeComponent";
import CompanyComponent from "./pages/CompanyComponent";
import CompanyDetailsComponent from "./pages/CompanyDetailsComponent";
import Config from "./utils/config";

ReactDOM.render(

  <Router>
  <Switch>

        <Route path="/" element={<Signin />} />
        <Route path="*" element={<Error />} />

        <Route path="/home" element={<PrivateRouteNew activepage="0"   page={(props)=> <HomeComponent {...props} />} /> }> 
        </Route>

        <Route path="/company" element={<PrivateRouteNew activepage="1"  page={(props)=> <CompanyComponent {...props} />} /> }>
        </Route>

        <Route path="/companydetails/:id" element={<PrivateRouteNew activepage="1"   page={(props)=> <CompanyDetailsComponent {...props} />} /> }>
        </Route>

        <Route path={Config.logoutPageUrl}element={<Logout />} />

   </Switch>
  </Router>,
  document.getElementById("root")
);
